	private List<MarketOrder> results;

	public void setResult(List<MarketOrder> results) {
		this.results = results;
	}
	
	public List<MarketOrder> getResult() {
		return results;
	}
	
	private static final String COMMAND = "blockchain_market_list_asks";
	
	public static CommandJson test(String quoteAssetSymbol, String baseAssetSymbol, int limit) {
		return doTest(COMMAND, new Object[] { quoteAssetSymbol, baseAssetSymbol, limit });
	}
	
	public static List<MarketOrder> run(String quoteAssetSymbol, String baseAssetSymbol, int limit) throws BTSSystemException {
		return run(0, quoteAssetSymbol, baseAssetSymbol, limit);
	}
	public static List<MarketOrder> run(int id, String quoteAssetSymbol, String baseAssetSymbol, int limit) throws BTSSystemException {
		BlockchainMarketListAsks i = (BlockchainMarketListAsks) new BlockchainMarketListAsks().doRun(
				id, COMMAND, new Object[] { quoteAssetSymbol, baseAssetSymbol, limit });
		i.checkSystemException();
		return i.getResult();
	}
	
